import React, { Component } from 'react'
import Link from 'react-router-dom';

export default class Navbar extends Component {
    render() {
        return (
            <header class="nav-home">
                <div class="nav-container">
                    <h1 class="nav-logo" style={{transform: "translate(-40rem, 25px)"}}>
                        <a class="link" herf="">BuyBAY</a>
                    </h1>
                    <a class="link sign-up" herf="/login">
                        <button style={{transform: "translate(37rem, -1rem)"}}>Sign Up</button>
                    </a>
                    <Link class="link Search" herf="/search">
                        <button style={{transform: "translate(37rem, -1rem)"}}>Search</button>
                    </Link>
                </div>
            </header>
        )
    }
}
